import React, { Component } from "react";
import "./Counter.css";

class Gente extends Component {
  state = {
    gente: [],
  };
  componentDidMount() {
    this.setState({ gente: this.props.people });
  }
  render() {
    console.log("this.props", this.props);
    console.log("this.props.people", this.props.people);

    console.log("this state gente", this.state.gente);

    const gente = this.state.gente;

    console.log("gente", gente);
    return (
      <div className="gentes">
        <section className="cards">
          {gente.map((el) => {
            return (
              <div className="card">
                <p key='name'>{el.name}</p>
                <img src={el.pictureUrl} alt="foto" key='foto'/>
                <p key='frase'> {el.frase}</p>
              </div>
            );
          })}
        </section>
      </div>
    );
  }
}

export default Gente;
